import {QuizServiceStub} from "src/app/services/QuizServiceStub";
import * as one from "src/app/modeStub.json";
import {BASE_URL} from "src/app/baseUrl.json";
import {QuizService} from "./QuizService";

const serviceConfig: {pathToData: string} = {pathToData: "../store/data.json"};

// Creating a new class based on Example Service
export const quizService = oneIS_MODE_STUB ? new QuizServiceStub(serviceConfig) : new QuizService(BASE_URL);
